@cicciorosina Sulle catene, sui lacci, sulle tempistiche che non rendono competitivo il sistema, hanno scarso effetto.
Capisco che per lei la media di 17 anni per un’opera pubblica siano normali ma nelle altre nazioni sono 4.
Quindi non mi rassegno.

